package Array_list;

import java.util.HashSet;

public class Exercise_10_Number_of {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	HashSet<String> cars = new HashSet<String>();
	
	cars.add("Volvo");
	cars.add("Volks Wagon");
	cars.add("Toyota");
	cars.add("Honda");
	cars.add("BMW");
	cars.add("Lexus");
	
	System.out.println("Hash Set copntains: " + cars);
	System.out.println("Size of the Hash Set is: " + cars.size());
	

	
	}

}
